 <img src="./dpr_files/ab87b74f-ea70-4def-a306-cc8735be48ef.jpg" alt="Anggota DPR Diciduk KPK, Komisi Pengawas PD: I Putu Sudiartana Kami Berhentikan!" title="Anggota DPR Diciduk KPK, Komisi Pengawas PD: I Putu Sudiartana Kami Berhentikan!" class=""> <span>Foto: Ruang I Putu Sudiartana Disegel KPK/Elza/detikcom</span>
 </div>
 <!-- E:read image orientation if potrait load this -->
 <!-- e:pic detail -->
 <b>Jakarta</b> - Anggota Komisi III DPR I Putu Sudiatana diciduk KPK. Sudiartana merupakan politisi Partai Demokrat (PD) dengan jabatan Wakil Bendahara Umum (Wabendum).<br><br>Atas penangkapan ini PD bereaksi. Putu Sudiartana dipecat dengan tidak hormat.<br><br>"Kami pasti akan memberhentikan yang bersangkutan," jelas anggota Komisi Pengawas PD Amir Syamsuddin, Rabu (29/6/2016).<br><br>Amir menjelaskan PD juga tidak akan memberikan bantuan hukum bagi Sudiartana. "PD tidak akan membela," terang dia.<br><br>Amir menyampaikan, berkaca dari kasus yang lalu, PD akan segera melakukan pemeriksaan dan memanggil pihak-pihak terkait.<br><br>"Kami proaktif, seperti yang lalu kami akan melakukan pemeriksaan," tegas dia.
 <br><strong>(dra/dra)</strong>
